import { defineConfig } from 'bumpp'

export default defineConfig({
  files: [
    'package.json',
    'packages/*/package.json',
  ],
})

// @ts-check
import antfu from '@antfu/eslint-config'

export default antfu(
  {
    type: 'lib',
    formatters: {
      html: false,
      markdown: true,
      css: true,
    },
    markdown: {
      overrides: {
        'unicorn/prefer-node-protocol': 'off',
        'import/first': 'off',
        'ts/explicit-function-return-type': 'off',
      },
    },
    vue: {
      overrides: {
        'ts/explicit-function-return-type': 'off',
      },
    },
    ignores: [
      '**/fixtures/**',
      '**/vendor/**',
      '**/test/out/**',
      'docs/languages.md',
      'docs/themes.md',
      // Generated Files
      'packages/shiki/src/langs/**',
      'packages/shiki/src/themes/**',
      'packages/shiki/src/langs-bundle-full.ts',
      'packages/shiki/src/langs-bundle-web.ts',
      'packages/shiki/src/themes.ts',
    ],
  },
  {
    rules: {
      'no-restricted-syntax': 'off',
      'ts/no-invalid-this': 'off',
    },
  },
  {
    files: ['docs/**/*.([cm])?[jt]s(x)?'],
    rules: {
      'ts/explicit-function-return-type': 'off',
    },
  },
  {
    files: [
      'packages/shiki/**/*.ts',
      'packages/core/**/*.ts',
      'packages/engine-javascript/**/*.ts',
      'packages/engine-oniguruma/**/*.ts',
    ],
    ignores: [
      '**/*.test.ts',
    ],
    rules: {
      'no-restricted-imports': [
        'error',
        {
          paths: [
            {
              name: 'shiki',
            },
          ],
        },
      ],
    },
  },
)

import { defineConfig } from 'taze'

export default defineConfig({
  ignorePaths: [
    '**/vendor/**',
    '**/node_modules/**',
  ],
  exclude: [
    'shiki-legacy',
    // The WASM in v2.0 is not compatible with our loader
    // As there seems to be no much improvement, I guess we could stick with the old version for a while longer
    'vscode-oniguruma',
  ],
})

import tsconfigPaths from 'vite-tsconfig-paths'
import { defineConfig } from 'vitest/config'
import { wasmPlugin } from './packages/engine-oniguruma/rollup.config.mjs'

export default defineConfig({
  plugins: [
    wasmPlugin(),
    tsconfigPaths(),
  ],
  test: {
    reporters: 'dot',
    exclude: [
      '**/vendor/**',
      '**/node_modules/**',
      '**/tm-grammars-themes/**',
    ],
    server: {
      deps: {
        inline: [
          /\.wasm/,
        ],
      },
    },
    coverage: {
      provider: 'v8',
      include: [
        '**/packages/*/src/**/*.ts',
      ],
      exclude: [
        '**/node_modules/**',
        '**/dist/**',
        '**/scripts/**',

        // Vendored code
        'packages/engine-oniguruma/src/oniguruma/onig.ts',
        '**/src/langs/**',
        '**/src/themes/**',
        '**/wasm-inlined.ts',

        // Integration packages that are hard to cover, or tested elsewhere
        'packages/cli/**',
        'packages/monaco/**',
        'packages/vitepress-twoslash/**',
      ],
    },
    poolOptions: {
      threads: {
        singleThread: true,
      },
    },
  },
})
